import React from 'react';
import {
    FaBehance,
    FaFacebook,
    FaLinkedin,
    FaTwitter,
    FaSketch,
    FaHome,
    FaUserFriends,
    FaFolderOpen,
} from 'react-icons/fa';
export const links = [
    {
        id: 1,
        url: '/',
        text: 'dashboard',
        icon: <FaHome />,
    },
    {
        id: 2,
        url: '/trade',
        text: 'trade',
        icon: <FaUserFriends />,
    },
    {
        id: 3,
        url: '/blockchain',
        text: 'blockchain',
        icon: <FaFolderOpen />,
    }
];

export const social = [
    {
        id: 1,
        url: 'https://www.twitter.com',
        icon: <FaFacebook />,
    },
    {
        id: 2,
        url: 'https://www.twitter.com',
        icon: <FaTwitter />,
    },
    {
        id: 3,
        url: 'https://www.twitter.com',
        icon: <FaLinkedin />,
    },
    {
        id: 4,
        url: 'https://www.twitter.com',
        icon: <FaBehance />,
    },
    {
        id: 5,
        url: 'https://www.twitter.com',
        icon: <FaSketch />,
    },
];
